Kris just returned home from a tour of duty with the Peace Corps in Brazil, and he's crashing at his sister's for the week until he starts his new job in San Diego. But he didn't know she had a roommate named Alexa, and Alexa didn't know her roommate's brother was staying at their place for the week. She says she won't allow him to freeload for the week, but says he can stay if he frees his load ... all over her lips and tits every night. There's no place like home.
